// SPDX-License-Identifier: CC0
pragma solidity = 0.8.19 || 0.8.20 || 0.8.23;
  
import {SMEambStorage} from "contracts/storage/LibSMEambStorage.sol";

/**
 * @title Proxy
 * @custom:version 0.1
 * @author ACTPOHABT denis.aka.wolf@gmail.com
 * @dev free - свободные функции
 *      lib - все внешние библиотеки
 *      mixins - миксины
 *      modules - имплементации модулей и функций
 *      storage - все библиотеки работы с хранилищем
 * 
 * @notice Точка входа в экосистему - динамический маршрутизатор
 *      Все имплементации отделены друг от друга и от хранилища.
 *      Логика описывается модулями, в то время как работа с хранилищем производится 
 *      только через библиотеки для раздельных хранилищ
**/

    struct TokenOwnership {
        // The address of the owner.
        address addr;
        // Stores the start time of ownership with minimal overhead for tokenomics.
        uint64 startTimestamp;
        // Whether the token has been burned.
        bool burned;
        // Arbitrary data similar to `startTimestamp` that can be set via {_extraData}.
        uint24 extraData;
    }
contract test{
    error ApprovalCallerNotOwnerNorApproved();
    error ApprovalQueryForNonexistentToken();
    error BalanceQueryForZeroAddress();
    error MintToZeroAddress();
    error MintZeroQuantity();
    error OwnerQueryForNonexistentToken();
    error TransferCallerNotOwnerNorApproved();
    error TransferFromIncorrectOwner();
    error TransferToNonERC721ReceiverImplementer();
    error TransferToZeroAddress();
    error URIQueryForNonexistentToken();
    error MintERC2309QuantityExceedsLimit();
    error OwnershipNotInitializedForExtraData();
    error SequentialUpToTooSmall();
    error SequentialMintExceedsLimit();
    error SpotMintTokenIdTooSmall();
    error TokenAlreadyExists();
    error NotCompatibleWithSpotMints();

    uint256 public constant _BITMASK_ADDRESS_DATA_ENTRY = (1 << 64) - 1;
    uint256 public constant _BITPOS_NUMBER_MINTED = 64;
    uint256 public constant _BITPOS_NUMBER_BURNED = 128;
    uint256 public constant _BITPOS_AUX = 192;
    uint256 public constant _BITMASK_AUX_COMPLEMENT = (1 << 192) - 1;
    uint256 public constant _BITPOS_START_TIMESTAMP = 160;
    uint256 public constant _BITMASK_BURNED = 1 << 224;
    uint256 public constant _BITPOS_NEXT_INITIALIZED = 225;
    uint256 public constant _BITMASK_NEXT_INITIALIZED = 1 << 225;
    uint256 public constant _BITPOS_EXTRA_DATA = 232;
    uint256 public constant _BITMASK_EXTRA_DATA_COMPLEMENT = (1 << 232) - 1;
    uint256 public constant _BITMASK_ADDRESS = (1 << 160) - 1;
    uint256 public constant _MAX_MINT_ERC2309_QUANTITY_LIMIT = 5000;
    bytes32 public constant _TRANSFER_EVENT_SIGNATURE =
        0xddf252ad1be2c89b69c2b068fc378daa952ba7f163c4a11628f55a4df523b3ef;

    struct TokenOwnership {
        // Владелец
        address addr;
        // Сохраняет время начала владения с минимальными накладными расходами на токеномику.
        uint64 startTimestamp;
        // Был ли токен сожжен.
        bool burned;
        // Произвольные данные, подобные startTimestamp, которые можно установить через {_extraData}.
        uint24 extraData;
    }

    function packedOwnerships(uint256 _tokenId) public view returns(uint256){return SMEambStorage._packedOwnerships(_tokenId);}
    function packedOwnerships(uint256 _tokenId, uint256 _index) public{SMEambStorage._packedOwnerships(_tokenId, _index);}
    function packedAddressData(address _owner) public view returns(uint256){return SMEambStorage._packedAddressData(_owner);}
    function packedAddressData(address _owner, uint256 _tokenId) public{SMEambStorage._packedAddressData(_owner, _tokenId);}

    function ownerOf2(uint256 tokenId) public view virtual returns (address) {
        return address(uint160(_packedOwnershipOf(tokenId)));
    }

        /**
     * @dev Returns the unpacked `TokenOwnership` struct at `index`.
     */
    function _ownershipAt(uint256 index) public view virtual returns (TokenOwnership memory) {
        return _unpackedOwnership(SMEambStorage._packedOwnerships(index));
    }

    /**
     * @dev Returns the unpacked `TokenOwnership` struct from `packed`.
     */
    function _unpackedOwnership(uint256 packed) public pure returns (TokenOwnership memory ownership) {
        ownership.addr = address(uint160(packed));
        ownership.startTimestamp = uint64(packed >> _BITPOS_START_TIMESTAMP);
        ownership.burned = packed & _BITMASK_BURNED != 0;
        ownership.extraData = uint24(packed >> _BITPOS_EXTRA_DATA);
    }

    /**
     * @dev Returns the packed ownership data of `tokenId`.
     */
    function _packedOwnershipOf(uint256 tokenId) public view returns (uint256 packed) {
        if (SMEambStorage._startTokenId() <= tokenId) {
            packed = SMEambStorage._packedOwnerships(tokenId);

            if (tokenId > _sequentialUpTo()) {
                if (_packedOwnershipExists(packed)) return packed;
                _revert(OwnerQueryForNonexistentToken.selector);
            }

            // If the data at the starting slot does not exist, start the scan.
            if (packed == 0) {
                if (tokenId >= SMEambStorage._currentIndex()) _revert(OwnerQueryForNonexistentToken.selector);
                // Invariant:
                // There will always be an initialized ownership slot
                // (i.e. `ownership.addr != address(0) && ownership.burned == false`)
                // before an unintialized ownership slot
                // (i.e. `ownership.addr == address(0) && ownership.burned == false`)
                // Hence, `tokenId` will not underflow.
                //
                // We can directly compare the packed value.
                // If the address is zero, packed will be zero.
                for (;;) {
                    unchecked {
                        packed = SMEambStorage._packedOwnerships(--tokenId);
                    }
                    if (packed == 0) continue;
                    if (packed & _BITMASK_BURNED == 0) return packed;
                    // Otherwise, the token is burned, and we must revert.
                    // This handles the case of batch burned tokens, where only the burned bit
                    // of the starting slot is set, and remaining slots are left uninitialized.
                    _revert(OwnerQueryForNonexistentToken.selector);
                }
            }
            // Otherwise, the data exists and we can skip the scan.
            // This is possible because we have already achieved the target condition.
            // This saves 2143 gas on transfers of initialized tokens.
            // If the token is not burned, return `packed`. Otherwise, revert.
            if (packed & _BITMASK_BURNED == 0) return packed;
        }
        _revert(OwnerQueryForNonexistentToken.selector);
    }



    /**
     * @dev Returns whether `packed` represents a token that exists.
     */
    function _packedOwnershipExists(uint256 packed) public pure returns (bool result) {
        assembly {
            // The following is equivalent to `owner != address(0) && burned == false`.
            // Symbolically tested.
            result := gt(and(packed, _BITMASK_ADDRESS), and(packed, _BITMASK_BURNED))
        }
    }

    function _sequentialUpTo() public view virtual returns (uint256) {
        return type(uint256).max;
    }

    /**
     * @dev For more efficient reverts.
     */
    function _revert(bytes4 errorSelector) internal pure {
        assembly {
            mstore(0x00, errorSelector)
            revert(0x00, 0x04)
        }
    }
}

